import datetime
def init(start_x,start_y,a_stern,world):
  predecessor = []
  Q = []
  distance = []
  mx = maxKoord[world]
  for i in range(mx): #assign distance, predecessor and Q array
    predecessor.append([])
    Q.append([])
    distance.append([])
    for j in range(mx):
      distance[i].append([float('inf'), float('inf'), a_stern])
      predecessor[i].append([0, 0])
      Q[i].append([i, j])
  #assign start node
  distance[start_x - 1][start_y - 1] = [0, 0, a_stern] # cords from 1 to 120 and arrays from 0 to 119  
  return (distance,predecessor,Q)

def distance_update(distance,predecessor,neighbour_node, min_node,world): #check neighbouring node of the minimum distance and edge
  eg_map = maps[world]
  try:
    alternate = float(distance[min_node[0]][min_node[1]][0]) + (float() + float(eg_map[neighbour_node[1]][neighbour_node[0]])) / 2
  except IndexError:
    print(min_node[0])
    print(distance[min_node[0]][min_node[1]][0])
    print(eg_map[min_node[1]][min_node[0]])
    print(neighbour_node[0])
  edges = 0
  #In the following it will look for which neighbouring node was submitted. Then it will check whether the predecessor generate another eg order or not.
  if(min_node[0]-1 == neighbour_node[0]):  #x-1
    if(min_node[1]-1 == neighbour_node[1]):  #y-1
      if(predecessor[min_node[0]][min_node[1]][0] == min_node[0]+1 and predecessor[min_node[0]][min_node[1]][1] == min_node[1]+1):
        edges = 0
      else:
        edges = 1
    elif(min_node[1] == neighbour_node[1]):  #y
      if(predecessor[min_node[0]][min_node[1]][0] == min_node[0]+1 and predecessor[min_node[0]][min_node[1]][1] <= min_node[1]+1 and predecessor[min_node[0]][min_node[1]][1] >= min_node[1]-1):
        edges = 0
      else:
        edges = 1
    elif(min_node[1]+1 == neighbour_node[1]):  #y+1
      if(predecessor[min_node[0]][min_node[1]][0] == min_node[0]+1 and predecessor[min_node[0]][min_node[1]][1] == min_node[1]-1):
        edges = 0
      else:
        edges = 1
  elif(min_node[0] == neighbour_node[0]):  #x
    if(min_node[1]-1 == neighbour_node[1]):  #y-1
      if(predecessor[min_node[0]][min_node[1]][0] >= min_node[0]-1 and predecessor[min_node[0]][min_node[1]][0] <= min_node[0]+1 and predecessor[min_node[0]][min_node[1]][1] == min_node[1]+1):
        edges = 0
      else:
        edges = 1
    elif(min_node[1]+1 == neighbour_node[1]):  #y+1
      if(predecessor[min_node[0]][min_node[1]][0] >= min_node[0]-1 and predecessor[min_node[0]][min_node[1]][0] <= min_node[0]+1 and predecessor[min_node[0]][min_node[1]][1] == min_node[1]-1):
        edges = 0
      else:
        edges = 1
  elif(min_node[0]+1 == neighbour_node[0]):  #x+1
    if(min_node[1]-1 == neighbour_node[1]): #y-1
      if(predecessor[min_node[0]][min_node[1]][0] == min_node[0]-1 and predecessor[min_node[0]][min_node[1]][1] == min_node[1]+1):
        edges = 0
      else:
        edges = 1
    elif(min_node[1] == neighbour_node[1]): #y
      if(predecessor[min_node[0]][min_node[1]][0] == min_node[0]-1 and predecessor[min_node[0]][min_node[1]][1] <= min_node[1]+1 and predecessor[min_node[0]][min_node[1]][1] >= min_node[1]-1):
        edges = 0
      else:
        edges = 1
    elif(min_node[1]+1 == neighbour_node[1]):  #y+1
      if(predecessor[min_node[0]][min_node[1]][0] == min_node[0]-1 and predecessor[min_node[0]][min_node[1]][1] == min_node[1]-1):
        edges = 0
      else:
        edges = 1
  edges += float(distance[min_node[0]][min_node[1]][1])
  if(alternate < distance[neighbour_node[0]][neighbour_node[1]][0]):  #set new distance only if alternate distance is smaller
    distance[neighbour_node[0]][neighbour_node[1]][0] = alternate
    distance[neighbour_node[0]][neighbour_node[1]][1] = edges
    predecessor[neighbour_node[0]][neighbour_node[1]] = min_node      
  elif (alternate == distance[neighbour_node[0]][neighbour_node[1]][0] and edges < distance[neighbour_node[0]][neighbour_node[1]][1]):  #if alternate distance like distance look for edges. Only the min_node with smallest edge will be the predecessor of the neighbouring node
    distance[neighbour_node[0]][neighbour_node[1]][0] = alternate
    distance[neighbour_node[0]][neighbour_node[1]][1] = edges                                
    predecessor[neighbour_node[0]][neighbour_node[1]] = min_node        
  return (distance,predecessor)


def create_shortest_path(predecessor,min_node):  #after found the target node generate the path (not like evergore path)
  shortestpath = [min_node]
  u = min_node
  while (predecessor[u[0]][u[1]][0] != 0):
    u = predecessor[u[0]][u[1]]      
    shortestpath.insert(0,[u[0], u[1]])
  return shortestpath     

def run_like_eg(start_node, end_node): #generate eg path given two nodes not values
  path = [start_node]
  def running(start_val, end_val):
    if(start_val < end_val):
      start_val+=1
    elif(start_val > end_val):
      start_val-=1
    return start_val
  while(start_node[0] != end_node[0] or start_node[1] != end_node[1]):
    start_node = [running(start_node[0], end_node[0]), running(start_node[1], end_node[1])]
    path.append(start_node)
  return path

def gen_order(shortestpath,distance):  #given the shortest path from start to target node (not evergore path) and convert it into order list
  orderlist=list()
  n = 0
  shortestpath_length = len(shortestpath)
  for i in range(shortestpath_length):  #compare the given shortest path bit by bit with the generate evergore path if it detect differences generate a new order
    eg_path = run_like_eg(shortestpath[n], shortestpath[i])
    for j in range(i-n):        
      if(eg_path[j][0] != shortestpath[n+j][0] or eg_path[j][1] != shortestpath[n+j][1]):        
        orderlist.append([shortestpath[i-1][0]+1, shortestpath[i-1][1]+1, distance[shortestpath[i-1][0]][shortestpath[i-1][1]][0]])
        n = i-1
        break
  orderlist.append([shortestpath[len(shortestpath)-1][0]+1, shortestpath[len(shortestpath)-1][1]+1, distance[shortestpath[i-1][0]][shortestpath[i-1][1]][0]])
  return orderlist

def dijkstra(start_x,start_y,end_x,end_y,a_stern,world):
    starttime = datetime.datetime.now()
    operation = 0
    target_node = [(end_x - 1), (end_y - 1)]
    (distance, predecessor, Q) = init(start_x,start_y,a_stern,world)
    # content of Q, predecessor & distance OK (jst)
    while (1) :
      min_node=[Q[0][0][0], Q[0][0][1]] #True x and y values
      min_indice= [0, 0] #indices in Q array
      Q_length = len(Q)
      distance_min_node = float(distance[min_node[0]][min_node[1]][0]) + float(distance[min_node[0]][min_node[1]][2])
      for i in range(Q_length): # find indices[x][y] of node with minimum distance
        Q_i_length = len(Q[i])
        for j in range(Q_i_length):
          if(distance[Q[i][j][0]][Q[i][j][1]][0] != float('inf')):
            if(distance[Q[i][j][0]][Q[i][j][1]][2] == float('inf')):
              distance[Q[i][j][0]][Q[i][j][1]][2] = len(run_like_eg(Q[i][j], target_node))
            distance_Q = float(distance[Q[i][j][0]][Q[i][j][1]][0]) + float(distance[Q[i][j][0]][Q[i][j][1]][2])
            if (distance_Q < distance_min_node):   #the minimum distance has first priority
              min_node=[Q[i][j][0], Q[i][j][1]]
              min_indice=[i, j]  
              distance_min_node = distance_Q
            elif(distance_Q == distance_min_node and distance[Q[i][j][0]][Q[i][j][1]][1] < distance[min_node[0]][min_node[1]][1]):  #the minimum edge has second priority
              min_node=[Q[i][j][0], Q[i][j][1]]
              min_indice=[i, j]
              distance_min_node = distance_Q
      operation += 1
      if(min_node[0] == target_node[0] and min_node[1] == target_node[1]):  #if target node is found generate path and exit while loop
          shortestpath = create_shortest_path(predecessor,min_node)
          break
      
      Q[min_indice[0]].pop(min_indice[1])  #delete found minimum node in Q array      
      if (len(Q[min_indice[0]]) == 0):#if all y indices splice also splice the x index in the array
        Q.pop(min_indice[0])
      Q_length = len(Q)
      for i in range(Q_length):  #looking for neighbouring nodes of found min node
        Q_i_length = len(Q[i])
        for j in range(Q_i_length):
          if(Q[i][j][0]>= min_node[0]-1 and Q[i][j][0]<= min_node[0]+1 and Q[i][j][1] >= min_node[1]-1 and Q[i][j][1] <= min_node[1]+1):
            (distance, predecessor) = distance_update(distance,predecessor,Q[i][j], min_node,world)
    orderlist = gen_order(shortestpath,distance)
    endtime = datetime.datetime.now()
    operation_duration = endtime - starttime
    return (orderlist, operation_duration, operation, shortestpath)

